<head>
    <style>
        table {
            font-family: Arial, sans-serif;
            font-size 14px;
            color: #000;
            max-width: 600px;
            margin: 0 auto;
            padding: 20px;

        }
        
        h3 {
            margin-top: 1rem;
            color: #344054;
            font-size: 30px;
        }
        
        h4 {
            color: #344054;
            font-size: 20px;
        }
        
        p {
            color: #667085;
            font-size: 16px;
            line-height: 28px;
        }
        
        span {
            color: #328BE0;
            font-size: 18px;
            font-weight: 700;
        }
        
        p.button {
            border-radius: 20px;
            width: 200px;
            background: linear-gradient(90deg, #1B75BC 22.31%, #29ABE2 63.55%);

            color: #FFFFFF;
            text-align: center;
        }
        
        p.button a {
            color: #FFFFFF;
            text-decoration: none;
        }
        
        .footer-links a {
            color: #667085;
            font-size: 14px;
            text-decoration: none;
        }
        
        .footer-text {
            color: #667085;
            font-size: 14px;
            display: flex;
            align-items: center;
            justify-content: center;
            margin-top: 20px;
            text-align: center;
            flex-direction: column;
        }
    </style>
